import Header from './Header';

const layoutStyle = {
    border: '1px solid #DDD',
    backgroundColor: '#EDFCF5'
};

const Layout = props => (
    <div style={layoutStyle}>
        <Header style={{ backgroundColor: " #C6CCB2" }} />
        {props.children}
    </div>
);

export default Layout;
